var SaElCookieConsent = function ($scope, $) {
    var $cookieConsent = $scope.find('.sa-el-cookie-consent'),
            $settings = $cookieConsent.data('settings'),
            editMode = Boolean(elementorFrontend.isEditMode());
    ;

    if (!$cookieConsent.length || editMode) {
        return;
    }

    window.cookieconsent.initialise($settings);

}
;
jQuery(window).on("elementor/frontend/init", function () {
    elementorFrontend.hooks.addAction(
            "frontend/element_ready/sa_el_cookie_consent.default",
            SaElCookieConsent
            );
});